import nodeRSA from "node-rsa";

export const decrypt = () => {
    const nodeRSA = require('node-rsa');
    const key = new nodeRSA({b: 1024});
    let secret='ciao Lorenzo Sciandra';
    let encrypted = key.encrypt(secret, 'base64');
    console.log(encrypted);
}

decrypt();
